		function getWays(){
			var n = $("#resultado").val();
			var c = $("#cantidadMatriz").val();

   
			if(n == ''){
				alert("Debe ingresar un valor al campo resultado");
				$("#resultado").focus();
				return false;
			}			
			if(c == ''){
				alert("Debe ingresar un valor al campo cantidad");
				$("#cantidadMatriz").focus();
				return false;
			}

		$.ajax({
			    url : 'app/process.php',
			    data : { n : n, c:c },
			    type : 'get',
			    dataType : 'text',contentType: "application/json",
			    success : function(response) {
			        $('#div1').html(response);
			    },

			});
		}